import mongoose,{Schema,model} from "mongoose";


const userSchema=new Schema({
     name:{
        type:String,
        required:true
     },
     email:{
        type:String,
        required:true,
        unique:true
     },
     password:{
        type:String,
        required:true
     },
     image:{
        type:String,//come from the cloudinary
        default:"data:image/png;base64,"
     },
     address:{
        type:Object,
        default:{
            line1:"",
            line2:""
        }
     },
     gender:{
        type:String,
        default:"not Selected"
     },
     dob:{
        type:String,
        default:"not selected"
     },
     phone:{
        type:String,
        default:"0000000000"
     }

    
},{minimize:false,timestamps:true});

//Pluralization only affects the MongoDB collection name, not the key inside mongoose.models.
export default userModel=mongoose.models.user ||model("User",userSchema);
//whenever this is executed then modle created multiple times so we use the || 